import React, { Component } from 'react';
import './App.css';
import Button from '@material-ui/core/Button';

class App extends Component {
  render() {
    return (
      <div className="App">
        <h1>Hello Leda we LOVE U!</h1>
<br></br><br></br><br></br><br></br><br></br>
        <div className="Tab"
        ><table >
        <tr>
          <th>We are</th>
        </tr>
        <tr>
          <td>Mohamed</td>
        </tr>
        <tr>
          <td>Emma</td>
        </tr>
        <tr>
          <td>Ryan</td>
        </tr>
      </table>
      </div>
      <br></br><br></br><br></br><br></br><br></br>
      <Button variant="contained" color="primary">
      Kiss Us
      </Button>

      </div>




    );



  }
}

export default App;
